(function () {
    'use strict';

    angular
        .module('app.filters')
        .filter('value', valueFilter);

    function valueFilter() {
        var parseString = function (input) {
            return input
                .replace(/\[(\w+)\]/g, '.$1') // convert indexes to properties
                .replace(/^\./, '') // strip a leading dot
                .split('.');
        };

        function getValue(object, propertyArray, defaultValue) {
            var value = object;

            for (var i = 0, n = propertyArray.length; i < n; ++i) {
                if (angular.isUndefined(value)){
                    return defaultValue;
                }
                var key = propertyArray[i];
                if (key in value) {
                    value = value[key];
                } else {
                    return defaultValue;
                }
            }

            return value;
        }

        //   js $filter('value')(obj,'part3[0].name')
        //    {{ obj | value:'part3[0].name' }}

        return function (object, pathString, defaultValue) {
            return getValue(object, parseString(pathString), defaultValue);
        }
    }
})();
(function () {
    'use strict';

    angular
        .module('app.filters')
        .filter('joinBr', joinBr);

    function joinBr() {
        return function (array) {
            return angular.isArray(array) ? array.join('<br>') : '';
        }
    }
})();
(function () {
    'use strict';

    angular
        .module('app.filters')
        .filter('format', formatFilter);

    function formatFilter() {
        //   js $filter('format')(obj,'{0} to {1}')
        //    {{ obj | value:'part3[0].name' }}

        return function (input) {
            var args = arguments;
            return input.replace(/\{(\d+)\}/g, function (match, capture) {
                return args[1 * capture + 1];
            });
        };
    }
})();
